import React, { Component } from 'react'
import {
    Header,
    Container,Segment
} from 'semantic-ui-react';
import Layout from './layout';
const Head = ()=>(
<Layout>    
    <Container text>
        <Segment
            inverted
            textAlign='center'
            style={{ minHeight: 100, padding: '2em 0em' }}
            vertical
            color='blue'
            >
         <Header
      as='h1'
      content='Weather'
      inverted
      style={{
        fontSize:'4em',
        fontWeight: 'normal',
        marginBottom: 0,
        marginTop: '1.5em',
      }}
    />
    </Segment>
    </Container>
    </Layout>
)

export default Head
